import{_ as o,c as t,o as a,aA as s}from"./chunks/framework.COfYLyzS.js";const m=JSON.parse('{"title":"Supported SBML Features","description":"","frontmatter":{},"headers":[],"relativePath":"support.md","filePath":"support.md","lastUpdated":null}'),c={name:"support.md"};function i(r,e,n,d,l,p){return a(),t("div",null,[...e[0]||(e[0]=[s('<h1 id="support" tabindex="-1">Supported SBML Features <a class="header-anchor" href="#support" aria-label="Permalink to &quot;Supported SBML Features {#support}&quot;">​</a></h1><p>SBMLImporter.jl supports a wide range of SBML features for models of level 2 or higher. This page provides an overview of the currently supported features, as well as the coverage of the SBML semantic and stochastic <a href="https://github.com/sbmlteam/sbml-test-suite" target="_blank" rel="noreferrer">test suites</a>.</p><h2 id="Overview" tabindex="-1">Overview <a class="header-anchor" href="#Overview" aria-label="Permalink to &quot;Overview {#Overview}&quot;">​</a></h2><p>In general, the following SBML features are supported:</p><ul><li><p>Events</p></li><li><p>Rate rules</p></li><li><p>Assignment rules</p></li><li><p>Algebraic rules</p></li><li><p>Dynamic compartment sizes</p></li><li><p>Species and model conversion factors</p></li><li><p>hasOnlySubstanceUnit</p></li></ul><p>Species can be defined in terms of concentration or amount, with units determined as follows:</p><ul><li><p>If <code>initialConcentration</code> is specified, the species is treated as a concentration.</p></li><li><p>If <code>initialAmount</code> is specified, it is treated as an amount.</p></li><li><p>If neither is set, and the species’ <code>substanceUnits</code> is <code>substance</code>, it defaults to amount.</p></li></ul><p>The following SBML features are not currently supported:</p><ul><li><p>Delays (i.e., delay differential equations)</p></li><li><p>Events with delay</p></li><li><p>Events with priority</p></li><li><p>Hierarchical (composite) models</p></li><li><p>Fast reactions</p></li><li><p>Parameter or species names that conflict with Julia constants (<code>pi</code>, <code>Inf</code>, <code>NaN</code>, <code>true</code>, <code>false</code>)</p></li><li><p>Certain uncommon MathML expressions (e.g., <code>lt</code> with three arguments, <code>implies</code>, etc.)</p></li></ul><h2 id="Semantic-Test-Suite-Coverage" tabindex="-1">Semantic Test Suite Coverage <a class="header-anchor" href="#Semantic-Test-Suite-Coverage" aria-label="Permalink to &quot;Semantic Test Suite Coverage {#Semantic-Test-Suite-Coverage}&quot;">​</a></h2><p>The <a href="https://github.com/sbmlteam/sbml-test-suite/tree/release/cases/semantic" target="_blank" rel="noreferrer">SBML semantic test suite</a> evaluates the correctness of deterministic ODE model simulations. SBMLImporter.jl currently passes 1266 out of 1821 test cases. A complete list of passed tests, and their corresponding <code>testTags</code> and <code>componentTags</code> can be found in <a href="https://github.com/sebapersson/SBMLImporter.jl/blob/main/sbml_testsuite_support.csv" target="_blank" rel="noreferrer">this</a> CSV-file, which is automatically updated every time a new release of the package is made.</p><p>Overall, at least one test case passes for each of the following SBML <code>testTags</code>:</p><p><code>Amount</code>, <code>NonUnityStoichiometry</code>, <code>BoundaryCondition</code>, <code>NonUnityCompartment</code>, <code>ConstantSpecies</code>, <code>LocalParameters</code>, <code>InitialValueReassigned</code>, <code>NonConstantParameter</code>, <code>0D-Compartment</code>, <code>NonConstantCompartment</code>, <code>MultiCompartment</code>, <code>ReversibleReaction</code>, <code>HasOnlySubstanceUnits</code>, <code>AssignedConstantStoichiometry</code>, <code>DefaultValue</code>, <code>Concentration</code>, <code>EventT0Firing</code>, <code>UncommonMathML</code>, <code>AssignedVariableStoichiometry</code>, <code>ConversionFactors</code>, <code>SpeciesReferenceInMath</code>, <code>VolumeConcentrationRates</code>, <code>NoMathML</code>, <code>L3v2MathML</code>, <code>BoolNumericSwap</code>.</p><p>And for each of the following SBML <code>componentTags</code>:</p><p><code>Compartment</code>, <code>Species</code>, <code>Reaction</code>, <code>Parameter</code>, <code>FunctionDefinition</code>, <code>EventNoDelay</code>, <code>InitialAssignment</code>, <code>AssignmentRule</code>, <code>RateRule</code>, <code>AlgebraicRule</code>, <code>StoichiometryMath</code>, <code>CSymbolTime</code>, <code>CSymbolAvogadro</code>, <code>CSymbolRateOf</code>.</p><h2 id="Stochastic-Test-Suite-Coverage" tabindex="-1">Stochastic Test Suite Coverage <a class="header-anchor" href="#Stochastic-Test-Suite-Coverage" aria-label="Permalink to &quot;Stochastic Test Suite Coverage {#Stochastic-Test-Suite-Coverage}&quot;">​</a></h2><p>The <a href="https://github.com/sbmlteam/sbml-test-suite/tree/release/cases/stochastic" target="_blank" rel="noreferrer">SBML stochastic test suite</a> primarily evaluates the correctness of stochastic model simulations using an exact algorithm. SBMLImporter.jl currently passes 37 out of 100 test cases. The low pass rate is because cases 40–100 involve the SBML Distribution extension, which is currently not supported. As with the semantic test suite, a complete list of passed test cases along with their associated <code>testTags</code> and <code>componentTags</code> is available in <a href="https://github.com/sebapersson/SBMLImporter.jl/blob/main/sbml_testsuite_support.csv" target="_blank" rel="noreferrer">this</a> CSV file.</p><p>Overall, at least one test case passes for each of the following <code>testTags</code>:</p><p><code>Amount</code>, <code>NonUnityStoichiometry</code>, <code>BoundaryCondition</code>, <code>NonUnityCompartment</code>, <code>ConstantSpecies</code>, <code>LocalParameters</code>, <code>InitialValueReassigned</code>.</p><p>And for each of the following SBML <code>componentTags</code>:</p><p><code>Compartment</code>, <code>Species</code>, <code>Reaction</code>, <code>Parameter</code>, <code>FunctionDefinition</code>, <code>EventNoDelay</code>, <code>InitialAssignment</code>, <code>AssignmentRule</code>, <code>RateRule</code>, <code>AlgebraicRule</code>.</p><h2 id="Support-for-additional-features" tabindex="-1">Support for additional features <a class="header-anchor" href="#Support-for-additional-features" aria-label="Permalink to &quot;Support for additional features {#Support-for-additional-features}&quot;">​</a></h2><p>If SBMLImporter lacks support for a feature you would like to have, please file an issue on <a href="https://github.com/sebapersson/SBMLImporter.jl" target="_blank" rel="noreferrer">GitHub</a>.</p>',23)])])}const h=o(c,[["render",i]]);export{m as __pageData,h as default};
